
export enum Sounds {
    PLACE,
    WIN,
    LOSE,
    ERROR
}

// Base64 encoded WAV files for sound effects
const audioSources: { [key in Sounds]: string } = {
[Sounds.PLACE]: 'data:audio/wav;base64,-',
[Sounds.WIN]: 'data:audio/wav;base64,',
// FIX: Using the PLACE sound for LOSE as a temporary measure.
[Sounds.LOSE]: 'data:audio/wav;base64,-,-',
// FIX: Using the PLACE sound for ERROR as a temporary measure.
[Sounds.ERROR]: 'data:audio/wav;base64,-,-'
}

/**
 * Plays a sound effect.
 * @param sound The sound to play from the `Sounds` enum.
 */
export function playAudio(sound: Sounds) {
    const audioSrc = audioSources[sound];
    if (audioSrc) {
        try {
            const audio = new Audio(audioSrc);
            // FIX: Audio playback should be handled properly.
            audio.play().catch(e => console.error("Error playing audio:", e));
        } catch (e) {
            console.error("Error creating audio:", e);
        }
    }
}
